import logo from './logo.svg';
import './App.css';
import UnstyledInputIntroduction from './components/Input';

function App() {
  const gridItems = [];

  // Create the grid items
  for (let row = 0; row < 6; row++) {
    for (let col = 0; col < 5; col++) {
      // Generate a unique key for each grid item
      const key = `cell-${row}-${col}`;
      // Push JSX for grid item into array
      gridItems.push(<div key={key} className="grid-cell">Cell {key}</div>);
    }
  }

  // Return the grid
  return (
    <div className="grid-container">
      {gridItems}
    </div>
  );
}

export default App;
